import React from 'react';

const Projects = () => {
  const projects = [
    {
      title: 'Asset Management System',
      description: 'A comprehensive system for managing organizational assets with tracking and reporting features.',
      tech: 'Java, Spring Boot, PostgreSQL'
    },
    {
      title: 'Digital Library System',
      description: 'Online library management system with book cataloging and user management.',
      tech: 'React, Node.js, MongoDB'
    },
    {
      title: 'University Website',
      description: 'Modern university website with course management and student portal.',
      tech: 'HTML, CSS, JavaScript, PHP'
    }
  ];

  return (
    <section id="projects" className="section" style={{ background: '#f8f9fa' }}>
      <div className="container">
        <h2>Projects</h2>
        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
          gap: '30px',
          marginTop: '40px'
        }}>
          {projects.map((project, index) => (
            <div key={index} style={{
              padding: '30px',
              background: 'white',
              borderRadius: '10px',
              boxShadow: '0 5px 15px rgba(0,0,0,0.1)',
              textAlign: 'left'
            }}>
              <h3 style={{ color: '#2c3e50', marginBottom: '15px' }}>
                {project.title}
              </h3>
              <p style={{ marginBottom: '15px' }}>
                {project.description}
              </p>
              <p style={{ 
                color: '#3498db', 
                fontWeight: 'bold',
                fontSize: '0.9rem'
              }}>
                {project.tech}
              </p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
